import React, { Component }     from 'react';
import { connect }              from 'react-redux';
import { searchModalOpen } from'../../Reducers';
import {withRouter} from 'react-router-dom';
import { Fab, Dialog, DialogContent, TextField } from '@material-ui/core'
import './fab.scss'



 class SearchFab extends Component{ 
    constructor(props){
        super(props);
        this.state={

         };

    }

    setSearch( value ) {
        this.props.searchModalOpen( value )
    }

    render() {
        const { isOpen } = this.props
        const searchBar = ({ isOpen })? <Dialog 
                                            open={isOpen} 
                                            onClose={this.setSearch( 'close' )} 
                                            aria-labelledby="form-dialog-title"
                                            >
                                            <DialogContent>
                                            <TextField
                                                autoFocus
                                                margin="dense"
                                                id="name"
                                                label="Email Address"
                                                type="email"
                                                fullWidth
                                            />
                                            </DialogContent>
                                        </Dialog>
                                    :
                                        <div></div>

        return(
            <div className = 'fabloc'>
               <Fab className='fab' onClick = {this.setSearch('open')}>
                <i class="material-icons">
                    search
                </i>
               </Fab>
            </div>

        );
    }
}
const mapStateToProps = state => {
    const isOpen = state.search_Model.isOpen;

        return{ isOpen };
}

const mapDispatchToProps = (dispatch) => {
    return{
        searchModalOpen:(bool) => dispatch( searchModalOpen(bool)),
    };
};

export default withRouter(connect(mapStateToProps, mapDispatchToProps )(SearchFab))
